function roman2int(r){if("string"!=typeof r)return"string is required";const n={I:1,IV:4,V:5,IX:9,X:10,XL:40,L:50,XC:90,C:100,CD:400,D:500,CM:900,M:1e3},t=r.trim();if(/^M{0,3}(?:D?C{0,3}|C[MD])(?:L?X{0,3}|X[CL])(?:V?I{0,3}|I[XV])$/.test(t)&&r){let r=null;return t.replace(/[MDLV]|C[MD]?|X[CL]?|I[XV]?/g,t=>{r+=n[t]}),r}return"Invalid or unsupported roman numeral"}module.exports=roman2int;